import React, {Component} from 'react'
class ProcessLog extends Component{
  render(){
    if (this.props.data){
      var logdata = this.props.data;
      console.log("***",logdata.user_id);

      var logs = this.props.data.map(function(logs){
        return <div key={logs.time}>{logs.user_id}, {logs.type}, {logs.revenue}</div>
      })
      console.log(logdata);
    }
    return(
      <section id='processlog'>
      <div className="row logs">
      {logs}
      </div>
      </section>
    );
  }
}
export default ProcessLog
